import './App.css';
import {BrowserRouter, Routes, Route} from 'react-router-dom';
import Home from './Pages/Home.js'
import Login from './Components/*';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <Routes>
        <Route path='/' element={<Home/>}></Route>
        <Route path='/login' element={<Login/>}></Route>
        <Route path='/signup' element={<SignUp/>}></Route>
        <Route path='/login/admin' element={<Admin/>}></Route>
        <Route path='/create' element={<SignUp/>}></Route>
        <Route path='/retrieve' element={<SignUp/>}></Route>
        <Route path='/update' element={<SignUp/>}></Route>
        <Route path='/delete' element={<SignUp/>}></Route>
      </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
